                                labelIcon={InfoIcon}
                                labelInfo="2,294"
                                color="#e3742f"
                                bgColor="#fcefe3"
                            />
                            <StyledTreeItem
                                nodeId="7"
                                labelText="Forums"
                                labelIcon={ForumIcon}
                                labelInfo="3,566"
                                color="#a250f5"
                                bgColor="#f3e8fd"
                            />
                            <StyledTreeItem
                                nodeId="8"
                                labelText="Promotions"
                                labelIcon={LocalOfferIcon}
                                labelInfo="733"
                                color="#3c8039"
                                bgColor="#e6f4ea"
                            />
                        </StyledTreeItem>
                    </TreeView>
                    :
                    null
            }
        </>
